import React from 'react';

const Todo = (text) => {
  return (
    <div className='card'>
        <h2>Title</h2>
        <div className='actions'>
          <p>{text}</p>
          <button className='btn'>Delete</button>
        </div>
      </div>
  )
}

export default Todo
